webpackJsonp([0x998c660d7b95],{6204:function(t,e){t.exports={data:{post:{html:"<p>I don't do anything serious in Windows, I just use it to play around. So I am rather proud that, without even trying, I managed to screw up my XP installation to the point that it no longer is able to boot (some kernel file is missing or damaged). I think I rebooted while the windows updater was running, or did something else equally as stupid. There's nothing there I really want to keep, so I'll just wipe it out and start again. I should really stick to stable operating systems, though.</p>",fields:{title:"Format, Install, Repeat",date:"04 Jul 2003",url:"https://papascott.de/2003-07-04-format-install-repeat/"}}},pathContext:{slug:"/2003-07-04-format-install-repeat/",prev:{fields:{title:"Don Park: Filters in News Aggregators",date:"04 Jul 2003",slug:"/2003-07-04-don-park-filters-in-news-aggregators/"}},next:{fields:{title:"Heise News-Ticker: Postbank und T-Online arbeiten zusammen",date:"04 Jul 2003",slug:"/2003-07-04-heise-news-ticker-postbank-und-t-online-arbeiten-zusammen/"}}}}}});
